import { useState, useEffect } from "react";

const ContentPokemon = (props) => {
  const [pokeinfo, setPokeinfo] = useState([]);
  const url = window.location.href;
  const nb = url.substring(url.lastIndexOf("/") + 1);
  let geturl = `https://pokeapi.co/api/v2/pokemon/${nb}`;
  let types = pokeinfo.types;
  let abilities = pokeinfo.abilities;

  const getInfos = async (geturl) => {
    const response = await fetch(geturl);
    const result = await response.json();
    console.log(result);
    return result;
  };

  useEffect(() => {
    getInfos(geturl).then((result) => setPokeinfo(result));
  }, [url]);

  const getWeight = (weight) => {
    const kg = weight / 10;
    return kg;
  };

  const getHeight = (height) => {
    const cm = height / 10;
    return cm;
  };

  const getTypeImg = () => {
    const type = element.type.name;
    let Typeimg = "";
    switch (type) {
      case "water":
        Typeimg = "../../../public/Assets/img/types/water.png";
        break;
      case "bug":
        Typeimg = "../../../public/Assets/img/types/bug.png";
        break;
      case "dark":
        Typeimg = "../../../public/Assets/img/types/dark.png";
        break;
      case "flying":
        Typeimg = "../../../public/Assets/img/types/flying.png";
        break;
    }
  };

  return (
    <>
      <div className="container">
        <div className="row">
          <div className="col-4 pokepageimg">
            {pokeinfo.sprites ? (
              <div className="row">
                <div className="col-6">
                  <p>Normal</p>
                  <img src={pokeinfo.sprites.front_default} />
                  <img src={pokeinfo.sprites.back_default} />
                </div>
                <div className="col-6">
                  <p>Shiny</p>
                  <img src={pokeinfo.sprites.front_shiny} />
                  <img src={pokeinfo.sprites.back_shiny} />
                </div>
              </div>
            ) : (
              <p></p>
            )}
          </div>

          <div className="col-3 pokepagemaininf">
            <div>
              <h2 className="capitalize">{pokeinfo.name}</h2>
              <h4>#{pokeinfo.id}</h4>
            </div>
            <div className="row">
              <div className="col-6">{getHeight(pokeinfo.height)}m</div>
              <div className="col-6">{getWeight(pokeinfo.weight)}kg</div>
            </div>
          </div>

          <div className="col-4 pokepagescndinf">
            <div className="row">
              <div className="col-4">Types</div>
              <div className="col-8">
                <div className="row">
                  {types ? (
                    types.map((element) => (
                      <div className="col">
                        <p className="capitalize">{element.type.name}</p>
                      </div>
                    ))
                  ) : (
                    <p></p>
                  )}
                </div>
              </div>
            </div>

            <div className="row">
              <div className="col-4">Abilities</div>
              <div className="col-8">
                <div className="row">
                  {abilities ? (
                    abilities.map((element) => (
                      <div className="col">
                        <p className="capitalize">{element.ability.name}</p>
                      </div>
                    ))
                  ) : (
                    <p></p>
                  )}
                </div>
              </div>
            </div>

            <div className="row">
              <div className="col-4">Egg Groups</div>
              <div className="col-8"></div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default ContentPokemon;
